import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faArrowRight } from "@fortawesome/free-solid-svg-icons";
import illustration from "../../assets/images/undraw_launching_re_tomg.svg";
import "./Signup.css";

const Signup = () => {
  return (
    <div className="sign-up">
      <div className="illustration"><img src={illustration} alt="launch" /></div>
      <div className="content">
        <form action="/signup">
          <div className="name">
            <label htmlFor="#name">Name</label>
            <input type="text" id="name" />
          </div>
          <div className="email">
            <label htmlFor="#email">Email</label>
            <input type="text" id="email" />
          </div>
          <div className="password">
            <label htmlFor="#password">Password</label>
            <input type="text" id="password" />
          </div>
          <div className="terms">
            <input type="checkbox" name="terms" id="terms" required/>
            <label htmlFor="#terms">I have read and agree the terms and conditions.</label>
          </div>
          <button type="submit"><FontAwesomeIcon icon={faArrowRight} /></button>
        </form>
        <h1>Sign Up</h1>
        <p>span</p>
      </div>

    </div>
  );
};

export default Signup;
